import React from 'react';

//react-router-dom package
import {BrowserRouter, Route} from 'react-router-dom';

//COMPONENTS
import Userorders from './Userorders.js';
import Header from './Nav.js';
import Userview from './Userview.js';
import ProductPanel from './ProductPanell.js';
import Productpanelaxios from './Productpanelaxios.js';
import UserOrder from './UserOrder.js';
import ViewOrder from './ViewOrder.js';
import EditProduct from './EditProduct.js';

const Routings=()=> {
    return (<>
           <BrowserRouter>

           <Header/>



           <Route exact path="/" component={UserOrder}/>
           <Route exact path="/userorder" component={UserOrder}/>
           <Route path="/userorders/:idno" component={Userview}/>
           <Route exact path="/order/:orderId" component={ViewOrder} />
           <Route path="/addproduct" component={ProductPanel}/>
           <Route path="/editproduct" component={EditProduct}/>
           <Route path="/productpanelaxios" component={Productpanelaxios}/>









           </BrowserRouter>



    </>)



}
export default Routings;
